import "../styles/Card.css";
import { NavLink } from "react-router-dom";

function Card(props) {
	const titre = props.infos.name;
	const image = props.infos.image;
	const description = props.infos.description;
	const date = props.infos.date;
	const url = props.infos.url;

	return (
		<a href={url}>
			<section class="card-container">
				<div class="card">
					<figure class="hexagon">
						<div class="card-content">
							<h1>{titre}</h1>
							<p>{description}</p>
						</div>
						<div class="hexagon-inset">
							<div class="card-content">
								<img src={image} alt="" />
							</div>
						</div>
					</figure>
				</div>
			</section>
		</a>
	);
}

export default Card;
